import styled from 'styled-components'
const Icon = ({ icon, size = '16px', onClick, title }) => (
  <IconWrapper
    title={title}
    size={size}
    onClick={() => {
      if (onClick) onClick()
    }}
    style={{ cursor: onClick ? 'pointer' : 'inherit' }}
  >
    {ICONS.hasOwnProperty(icon) ? ICONS[icon]() : ICONS['default']()}
  </IconWrapper>
)

const IconWrapper = styled.button`
  padding: 0;
  background: none;
  border: none;
  outline: none;
  display: flex;
  justify-content: center;
  align-items: center;
  min-width: ${(props) => props.size};
  max-width: ${(props) => props.size};
  min-height: ${(props) => props.size};
  max-height: ${(props) => props.size};
  svg {
    width: 100%;
    height: 100%;
  }
`

